    componentDidMount() {
        alert("")
    }

  render() {
    return (

      <div className="parallax">

        <div className="App">

            <div className="wrapper">

            <div className="header">
                <h1>Pixar Trivia!</h1>
            </div>

            <Timer />   

            <div className="questionSection">
                <Questions />
            </div>

            {/* this.state.articles.length > 0 && ...*/}
            <div className="resultsDiv">
                <Results />
            </div>

            </div>

        </div>

      </div>
    );
  }
}

export default App;
